import { useState } from "react";

function UserDashboard() {
  // Dummy event data
  const eventsData = [
    {
      id: 1,
      title: "Tech Talk 2025",
      date: "2025-10-25",
      category: "Technology",
      venue: "Online",
    },
    {
      id: 2,
      title: "Art Exhibition",
      date: "2025-11-10",
      category: "Culture",
      venue: "City Art Gallery",
    },
    {
      id: 3,
      title: "Music Concert",
      date: "2025-12-05",
      category: "Entertainment",
      venue: "Central Park",
    },
    {
      id: 4,
      title: "AI Workshop",
      date: "2025-11-20",
      category: "Technology",
      venue: "Innovation Lab",
    },
  ];

  const [search, setSearch] = useState("");
  const [category, setCategory] = useState("");
  const [date, setDate] = useState("");
  const [registeredEvents, setRegisteredEvents] = useState([]);

  // Filter logic
  const filteredEvents = eventsData.filter((event) => {
    return (
      event.title.toLowerCase().includes(search.toLowerCase()) &&
      (category ? event.category === category : true) &&
      (date ? event.date === date : true)
    );
  });

  // Register event
  const handleRegister = (event) => {
    if (!registeredEvents.find((e) => e.id === event.id)) {
      setRegisteredEvents([...registeredEvents, event]);
      alert(`‚úÖ You successfully registered for ${event.title}`);
    } else {
      alert(`‚ö†Ô∏è You have already registered for ${event.title}`);
    }
  };

  // Logout handler
  const handleLogout = () => {
    window.location.href = "/home";
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Navbar */}
      <nav className="bg-blue-700 text-white px-8 py-4 flex justify-between items-center shadow-md">
        <h1 className="text-2xl font-bold">Event Coordination Engine</h1>
        <div className="flex space-x-8 text-lg">
          <a href="/home" className="hover:text-gray-200">Home</a>
          <a href="#browse" className="hover:text-gray-200">Browse Events</a>
          <a href="#registered" className="hover:text-gray-200">My Events</a>
          <a href="#profile" className="hover:text-gray-200">Profile</a>
          <button onClick={handleLogout} className="hover:text-gray-200">Logout</button>
        </div>
      </nav>

      {/* Hero Section */}
      <section className="text-center py-10">
        <h2 className="text-3xl font-bold text-gray-800">
          Welcome, <span className="text-blue-600">User</span>
        </h2>
        <p className="text-gray-600 mt-2">
          Find interesting events happening around you
        </p>
        <button
          onClick={() =>
            document.getElementById("browse").scrollIntoView({ behavior: "smooth" })
          }
          className="mt-6 bg-blue-600 text-white px-6 py-3 rounded-lg font-semibold hover:bg-blue-700"
        >
          Browse Events
        </button>
      </section>

      <div className="flex flex-col md:flex-row px-10 gap-10">
        {/* Main Content */}
        <div className="flex-1">
          {/* Upcoming Events */}
          <section id="browse" className="mb-12">
            <h3 className="text-2xl font-bold mb-4">Upcoming Events</h3>
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
              {filteredEvents.map((event) => (
                <div
                  key={event.id}
                  className="bg-white p-6 rounded-xl shadow hover:shadow-lg transition"
                >
                  <h4 className="text-lg font-semibold text-gray-800 mb-2">
                    {event.title}
                  </h4>
                  <p className="text-gray-500 text-sm mb-1">
                    üìÖ {event.date}
                  </p>
                  <p className="text-gray-500 text-sm mb-1">
                    üìç {event.venue}
                  </p>
                  <p className="text-gray-500 text-sm mb-4">
                    üè∑Ô∏è {event.category}
                  </p>
                  <button
                    onClick={() => handleRegister(event)}
                    className={`w-full py-2 rounded-lg font-semibold ${
                      registeredEvents.find((e) => e.id === event.id)
                        ? "bg-gray-400 cursor-not-allowed"
                        : "bg-blue-600 hover:bg-blue-700 text-white"
                    }`}
                    disabled={registeredEvents.find((e) => e.id === event.id)}
                  >
                    {registeredEvents.find((e) => e.id === event.id)
                      ? "Registered"
                      : "Register"}
                  </button>
                </div>
              ))}
            </div>
          </section>

          {/* Registered Events */}
          <section id="registered" className="mb-12">
            <h3 className="text-2xl font-bold mb-4">My Registered Events</h3>
            {registeredEvents.length === 0 ? (
              <p className="text-gray-600">You haven‚Äôt registered for any events yet.</p>
            ) : (
              <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
                {registeredEvents.map((event) => (
                  <div
                    key={event.id}
                    className="bg-white p-6 rounded-xl shadow hover:shadow-lg transition"
                  >
                    <h4 className="text-lg font-semibold text-gray-800 mb-2">
                      {event.title}
                    </h4>
                    <p className="text-gray-500 text-sm mb-1">üìÖ {event.date}</p>
                    <p className="text-gray-500 text-sm">Status: ‚úÖ Registered</p>
                  </div>
                ))}
              </div>
            )}
          </section>
        </div>

        {/* Sidebar - Search & Profile */}
        <div className="w-full md:w-1/3">
          {/* Search and Filter */}
          <div className="bg-white p-6 rounded-xl shadow mb-8">
            <h3 className="text-xl font-bold mb-4">Search & Filter</h3>
            <input
              type="text"
              placeholder="Search by keyword..."
              className="w-full border p-2 rounded mb-3"
              value={search}
              onChange={(e) => setSearch(e.target.value)}
            />
            <select
              className="w-full border p-2 rounded mb-3"
              value={category}
              onChange={(e) => setCategory(e.target.value)}
            >
              <option value="">All Categories</option>
              <option value="Technology">Technology</option>
              <option value="Culture">Culture</option>
              <option value="Entertainment">Entertainment</option>
            </select>
            <input
              type="date"
              className="w-full border p-2 rounded mb-3"
              value={date}
              onChange={(e) => setDate(e.target.value)}
            />
            <button
              onClick={() => {
                setSearch("");
                setCategory("");
                setDate("");
              }}
              className="bg-blue-600 text-white w-full py-2 rounded hover:bg-blue-700"
            >
              Clear Filters
            </button>
          </div>

          {/* Profile Section */}
          <div id="profile" className="bg-white p-6 rounded-xl shadow">
            <h3 className="text-xl font-bold mb-4">Profile</h3>
            <div className="flex items-center space-x-4 mb-3">
              <div className="w-12 h-12 bg-gray-300 rounded-full"></div>
              <div>
                <p className="font-semibold text-gray-800">User Name</p>
                <p className="text-gray-500 text-sm">user@email.com</p>
              </div>
            </div>
            <button className="bg-blue-600 text-white w-full py-2 rounded hover:bg-blue-700">
              Edit Profile
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default UserDashboard;
